INSERT INTO `diseases` VALUES (1,'Fanconi Anemia','1/300.000','Immune','Stem cells transplant','Progressive pancytopenia','Fanconi anemia is a condition that affects many parts of the body. People with this condition may have bone marrow failure, physical abnormalities, organ defects, and an increased risk of certain cancers. The major function of bone marrow is to produce new blood cells'),(2,'Hereditary angioedema','1/50.000','Integumentary','Antihistamines','Swelling','Hereditary angioedema is a disorder characterized by recurrent episodes of severe swelling (angioedema). The most common areas of the body to develop swelling are the limbs, face, intestinal tract, and airway. Minor trauma or stress may trigger an attack, but swelling often occurs without a known trigger.'),(3,'Ebstein\'s anomaly','1-5/100.000','Cardiovascular','Surgery','Tricuspid valve defect','Ebstein anomaly is a congenital malformation of the heart that is characterized by apical displacement of the septal and posterior tricuspid valve leaflets, leading to atrialization of the right ventricle with a variable degree of malformation and displacement of the anterior leaflet.'),(4,'Takayasu  arteritis','1,5/1.000.000','Cardiovascular','Glucocorticoids, angioplasty','Vasculitis, hipotension','Takayasu\'s arteritis, also called TAK, is a rare form of vasculitis disease involving inflammation in the walls of the largest arteries in the body: the aorta and its main branches. The disease results from an attack by the body\'s own immune system, causing inflammation in the walls of arteries.'),(5,'Juvenile rheumatoid arthritis','1/50.000','Osseous','Corticosteroids, anti-inflammatory','Joint inflammation','Juvenile rheumatoid arthritis (JRA), often referred to by doctors today as juvenile idiopathic arthritis (JIA), is a type of arthritis that causes joint inflammation and stiffness for more than six weeks in a child aged 16 or younger. It affects approximately 50,000 children in the United States'),(6,'Friedrich\'s ataxia','1/50.000','Nervous','_','Lack of coordination','Friedreich ataxia (also called FA) is a rare inherited disease that causes progressive nervous system damage and movement problems. It usually begins in childhood and leads to impaired muscle coordination (ataxia) that worsens over time.'),(7,'Spinal muscular atrophy','1/75.000','Locomotive','Nusinersen, onasemnogene abeparvovec-xioi','Blood test (SMN1 gene)','Spinal muscular atrophy is a genetic disorder characterized by weakness and wasting (atrophy) in muscles used for movement (skeletal muscles). It is caused by a loss of specialized nerve cells, called motor neurons that control muscle movement.'),(8,'Hereditary optic atrophy','1/25.000','Optical','Idebenone and EPI-743','Blurring and clouding of vision','Leber hereditary optic neuropathy (LHON) is an inherited form of vision loss. Although this condition usually begins in a person\'s teens or twenties, rare cases may appear in early childhood or later in adulthood. For unknown reasons, males are affected much more often than females'),(9,'Walker carcinoma 256','_','Optical','_','Eye redness','Walker carcinoma 256 is one of the most rare conditions of all. It is a slow growing tumor that is located in the eye and that mainly affects people of the male sex and over 70 years of age. This tumor is usually identified after a consultation in which the patient presents some discomfort in the eyes.'),(10,'Cardiacs','_','_','_','_','_'),(11,'Eisenmenger complex','6/1.000','Cardiovascular','Pulmonary arterial hypertension therapies','Ventricular septal defect','A condition associated with VENTRICULAR SEPTAL DEFECT and other congenital heart defects that allow the mixing of pulmonary and systemic circulation, increase blood flow into the lung, and subsequent responses to low oxygen in blood.'),(12,'Sclerotic tuberous complex','1/6.000','Multiple','Vigabatrin','Benign tumors in brain, kidney, lungs and skin','Tuberous sclerosis (also called tuberous sclerosis complex, or TSC) is a rare, multi-system genetic disease that causes non-cancerous (benign) tumors to grow in the brain and on other vital organs such as the kidneys, heart, eyes, lungs, and skin. It usually affects the central nervous system and can result in a combination of symptoms including seizures, impaired intellectual development, autism, behavioral problems, skin abnormalities, and kidney disease.'),(13,'Factor XII deficiency','1/1.000.000','Circulatory','_','Abnormal PTT and PT','Factor XII deficiency is a rare genetic blood disorder that causes prolonged clotting (coagulation) of blood in a test tube without the presence of prolonged clinical bleeding tendencies. It is caused by a deficiency of the factor XII (Hageman factor), a plasma protein (glycoprotein).'),(14,'Hepatolenticular degeneration','1/30.000','Liver','Removing excess accumulated copper','Defect in the ATP7B gene','Hepatolenticular degeneration (Wilson\'s disease) is a hereditary disease in which metabolic disorder of copper leads to its accumulation in the liver, brain, cornea and kidneys with consequent pathologic changes in those organs.'),(15,'Vascular dementia','2/100.000','Nervous','_','Slowness of thoughts','Vascular dementia is a decline in thinking skills caused by conditions that block or. reduce blood flow to various regions of the brain, depriving them of oxygen and. nutrients'),(16,'Herpetiform dermatitis','0.8-2.7 / 100.000','Skin','Dapsone','Blisters filled with a watery fluid','Dermatitis Herpetiformis. Share. Dermatitis herpetiformis, also known as DH and Duhring\'s disease, is a chronic skin condition caused by a reaction to gluten ingestion. The vast majority of patients with DH also have an associated gluten sensitive enteropathy (celiac disease).'),(17,'Polyostotic fibrous dysplasia','1/7.500','Osseous','Surgery','Solid bones in X-ray','Fibrous dysplasia is a monostotic or polyostotic bone growth disorder caused by mosaicism involving the mesenchymal tissue. The presenting signs include pain and spontaneous fractures'),(18,'Craniofacial dysstosis','1.6/100.000','Osseous','Surgery','Cranial deformations on MR','The term craniofacial dysostosis\" is used in a general way to describe syndromal forms of craniosynostosis. These disorders are characterized by sutural involvement that not only includes the cranial vault but also extends into the skull base and midfacial skeletal structures.\"'),(19,'Neuroaxonal dystrophies','_','Nervous','_','Genetic test','Infantile neuroaxonal dystrophy (INAD) is a rare inherited neurological disorder. It affects axons, the part of a nerve cell that carries messages from the brain to other parts of the body, and causes progressive loss of vision, muscular control, and mental skills.'),(20,'Encefalitis','_','_','_','_','_'),(21,'Enchondromatosis (Ollier disease)','1/100.000','Osseous','Surgery','Enchondromas on X-RAY','Enchondromatosis, also known as Ollier disease, is a non-hereditary, sporadic, skeletal disorder characterized by multiple enchondromas principally located in the metaphyseal regions.'),(22,'Meniere\'s disease','18/10.000','Auditive','Dizzines medicines','Hearing and balance affections','Meniere\'s disease is a disorder that affects the inner ear. The inner ear is responsible for hearing and balance. The condition causes vertigo, the sensation of spinning. It also leads to hearing problems and a ringing sound in the ear. Meniere\'s disease usually affects only one ear.'),(23,'Addison\'s disease','5/100.000','Endocrine','Hormone replacement therapy','ACTH test','Addison\'s disease, also known as primary adrenal insufficiency and hypocortisolism, is a long-term endocrine disorder in which the adrenal glands do not produce enough steroid hormones.'),(24,'Bowen\'s disease','_','Skin','Surgery, chemotherapy, radiotherapy','Red, scaly patch on the skin','Bowen\'s disease. Bowen\'s disease is a very early form of skin cancer that\'s easily treatable. The main sign is a red, scaly patch on the skin. It affects the squamous cells, which are in the outermost layer of skin, and is sometimes referred to as squamous cell carcinoma in situ.'),(25,'Caroli\'s disease','1/100.000','Hepatic','Antibiotics, ursodeoxycholic','Widening of the intrahepatic ducts','Caroli disease is a rare inherited disorder characterized by abnormal widening (dilatation) of the ducts that carry bile from the liver (intrahepatic bile ducts). According to the medical literature, there are two forms of Caroli disease.'),(26,'Charcot-Marie Tooth disease','1/3.300','Nervous','Surgery','Electromyography, nerve biopsy and genetic testing','Charcot-Marie-Tooth disease (CMT) is a group of inherited conditions that damage the peripheral nerves. It\'s also known as hereditary motor and sensory neuropathy (HMSN) or peroneal muscular atrophy (PMA). The peripheral nerves are found outside the main central nervous system (brain and spinal cord).'),(27,'Chron\'s disease','0.1-16/100.000','Digestive','Surgery','Colonoscopy and barium x-ray','Crohn\'s disease is an inflammatory bowel disease (IBD). It causes inflammation of your digestive tract, which can lead to abdominal pain, severe diarrhea, fatigue, weight loss and malnutrition. Inflammation caused by Crohn\'s disease can involve different areas of the digestive tract in different people'),(28,'Dupuytren\'s disease','34/100.000','Muscular','Surgery','Look and feel of the hands','Dupuytren\'s contracture is a condition in which one or more fingers become permanently bent in a flexed position. It usually begins as small, hard nodules just under the skin of the palm, then worsens over time until the fingers can no longer be straightened.'),(29,'Fox-Fordyce disease','1/100.000','Skin','Estrogen hormones, oral retinoids, steroid creams and topical antibiotics.','Blockage of the apocrine sweat glands','Fox-Fordyce disease is a chronic skin disease most common in women aged 13-35 years. It is characterized by the development of intense itching in the underarm area, the pubic area, and around the nipple of the breast as a result of perspiration which becomes trapped in the sweat gland and surrounding areas.'),(30,'Gaucher disease','1/60.000','Multiple','Enzyme replacement therapy','Beta-glucosidase leukocyte (BGL) test','Gaucher disease is a genetic disorder where fat-laden Gaucher cells build up in areas like the spleen, liver and bone marrow. A person will get Gaucher Disease if both parents are carriers of the disease. It is one of the most common lysosomal storage disorders.'),(31,'Hartnup\'s disease','1/30.000','Multiple','Daily supplementation','Lack of vitamins and aminoacids','Hartnup disease is a condition caused by the body\'s inability to absorb certain protein building blocks (amino acids) from the diet. As a result, affected individuals are not able to use these amino acids to produce other substances, such as vitamins and proteins.'),(32,'Hirschspung\'s disease','37/100.000','Neurological','Surgery','Abscence of ganglions','Hirschsprung disease (HSCR) is a birth defect. This disorder is characterized by the absence of particular nerve cells (ganglions) in a segment of the bowel in an infant. The absence of ganglion cells causes the muscles in the bowels to lose their ability to move stool through the intestine (peristalsis).'),(33,'Hodgkin\'s disease','3/100.000','Immune','Surgery, chemotherapy, radiotherapy','Blood count and analysis of white blood cells','Hodgkin lymphoma (HL) is a type of lymphoma in which cancer originates from a specific type of white blood cells called lymphocytes. Symptoms may include fever, night sweats, and weight loss. Often there will be non-painful enlarged lymph nodes in the neck, under the arm, or in the groin.'),(34,'Hungtington\'s disease','2.7/100.000','Nervous','Tetrabenazine','Genetic test to check expanded HTT gene','Huntington\'s disease (HD) is a fatal genetic disorder that causes the progressive breakdown of nerve cells in the brain. It deteriorates a person\'s physical and mental abilities usually during their prime working years and has no cure'),(35,'Lafora\'s disease','1.2/100.000','Nervous','_','Genetic test on chromosome (EMP2A and EMP2B)','Lafora disease is an inherited , severe form of progressive myoclonus epilepsy. The condition most commonly begins with epileptic seizures in late childhood or adolescence. Other signs and symptoms include difficulty walking, muscle spasms (myoclonus) and dementia .'),(36,'Leigh\'s disease','1-9/100.000','Nervous','Thiamine or Vitamin B1','Lactic acid concentration test','Leigh syndrome is a severe neurological disorder that usually becomes apparent in the first year of life. This condition is characterized by progressive loss of mental and movement abilities (psychomotor regression) and typically results in death within two to three years, usually due to respiratory failure'),(37,'Machado-Joseph disease','3.1/100.000','Nervous','Antipasmodics','Degeneration of particular areas of the brain','Machado-Joseph Disease (MJD-III), also called spinocerebellar ataxia type III, is a rare, inherited, ataxia (lack of muscular control) affecting the central nervous system and characterized by the slow degeneration of particular areas of the brain called the hindbrain.'),(38,'Mikulicz´s disease','1.4/100.000','Endocrine','Medical therapies','Biopsy of one of the swollen glands','Mikulicz Syndrome (MS) is a rare chronic condition characterized by the abnormal enlargement of glandular tissue in the head and neck. Patients usually present with enlarged lacrimal and parotid glands'),(39,'Moyamoya´s disease','0.94/100.000','Cardiovascular','Revascularization surgery','Blocked brain arteries','Moyamoya disease is caused by blocked arteries at the base of the brain. The name moyamoya\" means \"puff of smoke\" in Japanese and describes the appearance of tiny vessels that form to compensate for the blockage. As the normal blood vessels narrow and become blocked'),(40,'Niemann-Pick´s disease','1.12/100.000','Hepatic','Statins for cholesterol control','Sphingomyelinase test in white blood cells','Niemann–Pick disease is a group of severe inherited metabolic disorders, in which sphingomyelin accumulates in lysosomes in cells'),(41,'Paget\'s disease','7/100.000','Osseous','Bisphosphonates','X-Ray','Paget\'s disease of bone interferes with your body\'s normal recycling process, in which new bone tissue gradually replaces old bone tissue. Over time, the disease can cause affected bones to become fragile and misshapen. Paget\'s disease of bone most commonly occurs in the pelvis, skull, spine and legs'),(42,'Papillon-Lefevre´s disease','1/100.000','Skin and dental','Retinoids','Urine analysis','Papillon–Lefèvre syndrome (PLS) is a rare autosomal recessive disorder, characterized by diffuse palmoplantar keratoderma and precocious aggressive periodontitis, leading to premature loss of deciduous and permanent dentition at a very young age'),(43,'Pelizaeus-Merzbacher´s disease','1/100.000','Nervous','Medication for movements disorders','Abnormal white matter throughout the brain','Pelizaeus-Merzbacher disease is an inherited condition involving the brain and spinal cord (central nervous system) that primarily affects males. This disease is one of a group of genetic disorders called leukodystrophies'),(44,'Pick\'s disease','2.7-4.1/100.000','Nervous','_','Buildup of tau proteins','Pick\'s disease is a rare type of age-related dementia that affects the frontal lobes of the brain and causes speech problems like aphasia, behavior difficulties and eventually death.'),(45,'Sandhoff´s disease','1-9/1.000.000','Nervous','Nutrition, hydratation and anticonvulsants','Deficiency of the enzyme beta-hexosaminidase','Sandhoff disease is a rare, inherited lipid storage disorder that progressively destroys nerve cells in the brain and spinal cord. It is caused by a deficiency of the enzyme beta-hexosaminidase, which results in the harmful accumulation of certain fats (lipids) in the brain and other organs of the body.'),(46,'Tangier\'s disease','1/1.000.000','Hepatic','Surgery','HDL test','Tangier disease is an inherited disorder characterized by significantly reduced levels of high-density lipoprotein (HDL) in the blood. HDL transports cholesterol and certain fats called phospholipids from the body\'s tissues to the liver, where they are removed from the blood'),(47,'Hypopituitarism','4.2/100.000','Endocrine','Hormone replacement therapy','Low hormone levels','Hypopituitarism is a condition in which the pituitary gland does not produce normal amounts of some or all of its hormones.'),(48,'Tay-Sachs´s disease','0.38/100.000','Nervous','Palliative care','Blood test (hexoaminidase A)','Tay-Sachs disease is a rare inherited disorder that progressively destroys nerve cells (neurons) in the brain and spinal cord. The most common form of Tay-Sachs disease becomes apparent in infancy.'),(49,'Glycogen storage disease','2.3/100.000','Hepatic','Diet therapy','Glycogen test','Glycogen storage disease (GSD) is a rare condition that changes the way the body uses and stores glycogen, a form of sugar or glucose. Glycogen is a main source of energy for the body. Glycogen is stored in the liver. When the body needs more energy, certain proteins called enzymes break down glycogen into glucose.'),(50,'Wolman´s disease','1/100.000','Hepatic','Enzyme replacement therapy,','Lysosomal lipase acid test','Wolman disease is a type of lysosomal acid lipase (LAL) deficiency; a rare genetic disorder characterized by complete absence of an enzyme known as lysosomal acid lipase (LIPA or LAL). This enzyme is required to breakdown (metabolize) certain fats (lipids) in the body'),(51,'Von Willebrand´s diseases','1/100.000','Blood','Desmopressin acetate','VWF antigen test','Von Willebrand disease (VWD) is a genetic disorder caused by missing or defective von Willebrand factor (VWF), a clotting protein. VWF binds factor VIII, a key clotting protein, and platelets in blood vessel walls, which help form a platelet plug during the clotting process'),(52,'Amyotrophic Lateral Sclerosis','2/100.000','Nervous','Riluzole and edaravone','EMG','Amyotrophic lateral sclerosis (ALS) is a group of rare neurological diseases that mainly involve the nerve cells (neurons) responsible for controlling voluntary muscle movement. Voluntary muscles produce movements like chewing, walking, and talking. The disease is progressive, meaning the symptoms get worse over time'),(53,'Barrett\'s esophagus','1.25/100.000','Digestive','Surgery','Endoscopy','Barrett\'s esophagus is a serious complication of GERD (gastroesophageal reflux disease). In Barrett\'s esophagus, normal tissue lining the esophagus changes to tissue that resembles the lining of the intestine. About 10% of people with chronic symptoms of GERD develop Barrett\'s esophagus.'),(54,'Cystic fibrosis','4/100.000','Respiratory and digestive','_','Genetic test (mutation CFTR)','It´s a hereditary disorder affecting the exocrine glands. It causes the production of abnormally thick mucus, leading to the blockage of the pancreatic ducts, intestines, and bronchi and often resulting in respiratory infection.'),(55,'Fusobacterium spondylodiscitis','3/100.000','Osseous','Surgery, antibiotics','Fusobacterium test','Infection accompanied by destruction of the vertebral bodies, starting at the endplates, but with secondary involvement of the intervertebral discs. The term spondylodiscitis\" means primary infection of the intervertebral disc by a pathogen'),(56,'Wegener\'s granulomatosis','1-9/100.000','Circulatory','Prednisone combined with cyclophosphamide','Blood and urine test','Granulomatosis with polyangiitis is an uncommon disorder that causes inflammation of the blood vessels in your nose, sinuses, throat, lungs and kidneys. Formerly called Wegener\'s granulomatosis, this condition is one of a group of blood vessel disorders called vasculitis. It slows blood flow to some of your organs'),(57,'Progressive facial hemiatrophy','1-3/100.000','Nervous','_','Unilateral facial atrophy','Progressive facial hemiatrophy (PFH) is a rare condition characterized by the slow, progressive appearance of a unilateral facial atrophy that affects the skin, subcutaneous tissue, muscle and bone.'),(58,'Paroxysmal nocturnal hemoglobinuria','1.59/100.000','Blood','Eculizumab','Flow cytometry','Paroxysmal nocturnal hemoglobinuria (PNH) is a rare bone marrow failure disorder that manifests with hemolytic anemia, thrombosis, and peripheral blood cytopenias.'),(59,'Hyperaldosteronism','1/100.000','Endocrine','Spironolactone or eplerenone','Aldosteron test','Hyperaldosteronism is a disease in which the adrenal gland(s) make too much aldosterone which leads to hypertension (high blood pressure) and low blood potassium levels. Primary hyperaldosteronism can be caused by either hyperactivity in one adrenal gland (unilateral disease) or both (bilateral disease).'),(60,'Hyperhidrosis','1/100.000','Skin','Surgery','Uncontrolled sweat','Hyperhidrosis is a condition characterized by abnormally increased sweating, in excess of that required for regulation of body temperature. Although primarily a physical burden, hyperhidrosis can deteriorate quality of life from a psychological, emotional, and social perspective.'),(61,'Lupus','10/100.000','Immune','Immunotherapy','Blood, urine test','Lupus is a systemic autoimmune disease that occurs when your body\'s immune system attacks your own tissues and organs. Inflammation caused by lupus can affect many different body systems — including your joints, skin, kidneys, blood cells, brain, heart and lungs'),(62,'Organization',NULL,NULL,NULL,NULL,NULL),(63,'Multiple ',NULL,NULL,NULL,NULL,NULL),(64,'Aarskog Syndrome','_','_','_','_','_'),(65,'Abetalipoproteinemia','_','_','_','_','_'),(66,'Ablepharon-Macrostomia Syndrome','_','_','_','_','_'),(67,'Acanthocheilonemiasis','_','_','_','_','_'),(68,'Acanthosis Nigricans','_','_','_','_','_'),(69,'Aceruloplasminemia','_','_','_','_